  <div>
    <h1>HATS PAGE</h1>
  </div>
) 

function App() {
  return (
    <div>
      {/* <Switch> */}
      <Route  path='/' component={HomePage}/>
      <Route  path='/hats' component={HatsPage}/>

      {/* </Switch> */}
    </div>
  );
}

export default App;
